import Content from "./Content/content";
import MyDate from "./MyDate/myDate";
import './logItem.css';
const Items = (props) => {
    console.log(props);
    return (
        <div className="item">
        <MyDate month="4" day="19" />
        <Content desc={props.name} time={props.time} />
        </div>
    );
}
export default Items;
